- uid: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NetworkCleartext
  commentId: F:SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NetworkCleartext
  id: NetworkCleartext
  parent: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType
  langs:
  - csharp
  - vb
  name: NetworkCleartext
  nameWithType: WindowsIdentityHelper.LogonType.NetworkCleartext
  fullName: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NetworkCleartext
  type: Field
  source:
    path: SoCore
    isExternal: true
  assemblies:
  - SoCore
  namespace: SuperOffice.Security.Util
  summary: "\nWindows 2000/XP: This logon type preserves the name and password in the authentication packages, allowing the server to make connections to other network servers while impersonating the client. This allows a server to accept clear text credentials from a client, call LogonUser, verify that the user can access the system across the network, and still communicate with other servers. \n"
  syntax:
    content: NetworkCleartext = 8
    return:
      type: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType
  modifiers.csharp:
