- uid: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NewCredentials
  commentId: F:SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NewCredentials
  id: NewCredentials
  parent: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType
  langs:
  - csharp
  - vb
  name: NewCredentials
  nameWithType: WindowsIdentityHelper.LogonType.NewCredentials
  fullName: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType.NewCredentials
  type: Field
  source:
    path: SoCore
    isExternal: true
  assemblies:
  - SoCore
  namespace: SuperOffice.Security.Util
  summary: "\nWindows 2000/XP: This logon type allows the caller to clone its current token and specify new credentials for outbound connections. The new logon session has the same local identify, but uses different credentials for other network connections. This logon type is supported only by the LOGON32_PROVIDER_WINNT50 logon provider. \n"
  syntax:
    content: NewCredentials = 9
    return:
      type: SuperOffice.Security.Util.WindowsIdentityHelper.LogonType
